#
# The Korg MS2000 seems to need a specific setup for it to function in sysex.
# The sysex documentation contains only one statement:
# "When the "SystemEx" parameter is set to "ENA", these messages are recognized."
#
# Additionally, we found
# "In fact, when switched ON my synth has 2 parameters set so as they are not able to communicate:
# 1. Memory protect is ON ; it must be OFF in order to be able to dump its content
# 2. Midi Clock is Internal ; it must be set as external, for the same reason."
# "be sure to enable System Exclusive on Global Mode"


def name():
    return "Korg MS2000"


def createDeviceDetectMessage(channel):
    # This is a sysex generic device detect message
    return [0xf0, 0x7e, channel & 0x0f, 0x06, 0x01, 0xf7]


def deviceDetectWaitMilliseconds():
    return 200


def generalMessageDelay():
    # The MS2000 doesn't seem to like to get the messages too fast, so wait a bit between messages
    # The better implementation would be probably to do a handshake implementation, as it will likely reply
    # with a 0x23 DATA LOAD COMPLETED message on a program change message?
    return 400


def needsChannelSpecificDetection():
    return True


def channelIfValidDeviceResponse(message):
    # The MS2000 answers with 15 bytes
    # +---------+------------------------------------------------+
    # | Byte[H] |                Description                     |
    # +---------+------------------------------------------------+
    # |   F0    | Exclusive Status                               |
    # |   7E    | Non Realtime Message                           |
    # |   0g    | MIDI Global Channel  ( Device ID )             |
    # |   06    | General Information                            |
    # |   02    | Identity Reply                                 |
    # |   42    | KORG ID              ( Manufacturers ID )      |
    # |   58    | MS2000 Series ID     ( Family ID   (LSB))      |
    # |   00    |                      ( Family ID   (MSB))      |
    # |   mm    |                      ( Member ID   (LSB))      |
    # |   00    |                      ( Member ID   (MSB))      |
    # |   xx    |                      ( Minor Ver.  (LSB))      |
    # |   xx    |                      ( Minor Ver.  (MSB))      |
    # |   xx    |                      ( Major Ver.  (LSB))      |
    # |   xx    |                      ( Major Ver.  (MSB))      |
    # |   F7    | END OF EXCLUSIVE                               |
    # +---------+------------------------------------------------+
    if (len(message) > 9
            and message[0] == 0xf0  # Sysex
            and message[1] == 0x7e  # Non-realtime
            and message[3] == 0x06  # Device request
            and message[4] == 0x02  # Device request reply
            and message[5] == 0x42  # KORG ID
            and message[6] == 0x58  # MS2000 Series ID
            and message[7] == 0x00
            and (message[8] == 0x01 or message[8] == 0x08)  # MS2000 Model (0x8 = MS2000R)
            and message[9] == 0x00):
        # Extract the current MIDI channel from index 2 of the message
        return message[2]
    return -1


def createEditBufferRequest(channel):
    # (2) CURRENT PROGRAM DATA DUMP REQUEST                              R
    # +----------------+--------------------------------------------------+
    # |     Byte       |             Description                          |
    # +----------------+--------------------------------------------------+
    # | F0,42,3g,58    | EXCLUSIVE HEADER                                 |
    # | 0001 0000 (10) | CURRENT PROGRAM DATA DUMP REQUEST      10H       |
    # | 1111 0111 (F7) | EOX                                              |
    # +----------------+--------------------------------------------------+
    return [0xf0, 0x42, 0x30 | (channel & 0x0f), 0x58, 0x10, 0xf7]


def isEditBufferDump(message):
    # +----------------+--------------------------------------------------+
    # |     Byte       |             Description                          |
    # +----------------+--------------------------------------------------+
    # | F0,42,3g,58    | EXCLUSIVE HEADER                                 |
    # | 0100 0000 (40) | CURRENT PROGRAM DATA DUMP              40H       |
    # | 0ddd dddd (dd) | Data                                  (NOTE 1,6) |
    # |     :          |  :                                               |
    # | 1111 0111 (F7) | EOX                                              |
    # +----------------+--------------------------------------------------+
    return (len(message) > 4
            and message[0] == 0xf0
            and message[1] == 0x42  # Korg
            and (message[2] & 0xf0) == 0x30
            and message[3] == 0x58  # MS2000
            and message[4] == 0x40)  # Current Program Data Dump


def numberOfBanks():
    return 8


def numberOfPatchesPerBank():
    return 16


def nameFromDump(message):
    if isEditBufferDump(message):
        # We need to first convert from 7 bit data to 8 bit data, before we can extract the program name
        patchData = unescapeSysex(message[5:-1])
        return ''.join([chr(x) for x in patchData[0:12]])
    return "Invalid"


def convertToEditBuffer(channel, message):
    if isEditBufferDump(message):
        # The data structures are the same, only byte 2 seems to contain the device ID (or channel), and
        # byte 4 should be 0x40, current program data dump
        return message[0:2] + [0x030 | (channel & 0x0f), 0x58, 0x40] + message[5:]
    raise Exception("Neither edit buffer nor program dump can't be converted")


def createBankDumpRequest(channel, bank):
    # |     1C      | PROGRAM DATA DUMP REQUEST                  |
    return [0xf0, 0x42, 0x30 | (channel & 0x0f), 0x58, 0x1c, 0xf7]


def isPartOfBankDump(message):
    return (len(message) > 4
            and message[0] == 0xf0
            and message[1] == 0x42  # Korg
            and (message[2] & 0xf0) == 0x30
            and message[3] == 0x58  # MS2000
            and (message[4] == 0x50 or message[4] == 0x4c))  # Program Data dump or All Data dump


def isBankDumpFinished(messages):
    for message in messages:
        if isPartOfBankDump(message):
            return True
    return False


def extractPatchesFromBank(message):
    if isPartOfBankDump(message):
        channel = message[2] & 0x0f
        data = unescapeSysex(message[5:-1])
        # There are different files out there with different number of patches (64 or 128), plus the global data
        data_pointer = 0
        result = []
        while data_pointer + 254 < len(data):
            # Read one more patch
            next_patch = data[data_pointer:data_pointer + 254]
            next_program_dump = [0xf0, 0x42, 0x30 | (channel & 0x0f), 0x58, 0x40] + escapeSysex(next_patch) + [0xf7]
            #print("Found patch " + nameFromDump(next_program_dump))
            result = result + next_program_dump
            data_pointer = data_pointer + 254
        return result
    raise Exception("This code can only read a single message of type 'ALL DATA DUMP'")


def unescapeSysex(sysex):
    result = []
    dataIndex = 0
    while dataIndex < len(sysex):
        # The first byte contains the highest (most significant = MS) bit of the next seven data bytes
        ms_bits = sysex[dataIndex]
        dataIndex += 1
        for i in range(7):
            if dataIndex < len(sysex):
                result.append(sysex[dataIndex] | ((ms_bits & (1 << i)) << (7 - i)))
            dataIndex += 1
    return result


def escapeSysex(data):
    result = []
    dataIndex = 0
    while dataIndex < len(data):
        ms_bits = 0
        for i in range(7):
            if dataIndex + i < len(data):
                ms_bits = ms_bits | ((data[dataIndex + i] & 0x80) >> (7 - i))
        result.append(ms_bits)
        for i in range(7):
            if dataIndex + i < len(data):
                result.append(data[dataIndex + i] & 0x7f)
        dataIndex += 7
    return result


